import React from 'react';
import styled from 'styled-components';

function LoginLoading() {
	return (
		<LoadingStatus>
			<div>
				<b />
			</div>
		</LoadingStatus>
	);
}
const LoadingStatus = styled.div`
	background-color: #fff;
	position: absolute;
	left: 0;
	right: 0;
	height: 100vh;
	z-index: 100;
	div {
		display: flex;
		height: 100%;
		align-items: center;
		justify-content: center;
		b {
			width: 100px;
			height: 100px;
			border-radius: 50%;
			background-color: #36f;
		}
	}
`;
export default LoginLoading;
